import React from 'react';
import { BiHomeAlt, BiUser } from 'react-icons/bi';
import { BsClipboardData, BsBriefcase, BsChatSquareText } from 'react-icons/bs';
import { Link } from 'react-scroll';
const Nav = () => {
	return (
		<nav className='fixed bottom-2 lg-bottom-8 w-full z-50'>
			<div className='container mt-auto'>
				{/* nav Link */}
				<div className='w-full bg-black/20 h-[96px] backdrop-blur-2xl rounded-full max-w-[460px] mx-auto flex px-5 justify-between text-2xl text-white/50 items-center'>
					<Link
						to='home'
						activeClass='active'
						smooth={true}
						spy={true}
						offset={-200}
						className='cursor-pointer w-[60px] h-[60px] flex justify-center  items-center'>
						<BiHomeAlt />
					</Link>
					<Link
						to='about'
						activeClass='active'
						smooth={true}
						spy={true}
						className='cursor-pointer w-[60px] h-[60px] flex justify-center items-center'>
						<BiUser />
					</Link>
					<Link
						to='services'
						activeClass='active'
						smooth={true}
						spy={true}
						className='cursor-pointer w-[60px] h-[60px] flex justify-center items-center'>
						<BsClipboardData />
					</Link>
					<Link
						to='work'
						activeClass='active'
						smooth={true}
						spy={true}
						className='cursor-pointer w-[60px] h-[60px] flex justify-center items-center'>
						<BsBriefcase />
					</Link>
					<Link
						to='contact'
						activeClass='active'
						smooth={true}
						spy={true}
						className='cursor-pointer w-[60px] h-[60px] flex justify-center items-center'>
						<BsChatSquareText />
					</Link>
				</div>
			</div>
		</nav>
	);
};

export default Nav;
